import React from 'react';
import '../../App.css';
import SignUpForm from "../RegisterForm";

export default function SignUp() {
  const singUpFrom = new SignUpForm
  return (
      <>
      <h1 className='sign-up'>Inscreva-se agora</h1>
        singUpFrom.render()
      </>
  )
  ;
}
